-- ----------------------------
-- Table structure for attachment_chunks
-- ----------------------------
DROP TABLE IF EXISTS `attachment_chunks`;
CREATE TABLE `attachment_chunks` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `aid` int(10) unsigned NOT NULL DEFAULT 0 COMMENT 'AttachmentFile ID',
  `index` int(10) unsigned NOT NULL DEFAULT 0 COMMENT '第几块',
  `start` int(10) unsigned NOT NULL DEFAULT 0 COMMENT '起始字节',
  `end` int(10) unsigned NOT NULL DEFAULT 0 COMMENT '结束字节',
  `basename` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '存储的文件名(包含扩展名)',
  `path` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '存储文件路径',
  `hash` varchar(50) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '文件MD5',
  `size` int(10) unsigned NOT NULL COMMENT '文件大小',
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `deleted_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `attachment_chunks_aid_foreign` (`aid`),
  KEY `attachment_chunks_index_index` (`index`),
  KEY `attachment_chunks_start_index` (`start`),
  KEY `attachment_chunks_end_index` (`end`),
  KEY `attachment_chunks_hash_index` (`hash`),
  KEY `attachment_chunks_size_index` (`size`),
  CONSTRAINT `attachment_chunks_aid_foreign` FOREIGN KEY (`aid`) REFERENCES `attachments` (`id`) ON DELETE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

