DROP TABLE IF EXISTS `attachment_files`;
CREATE TABLE `attachment_files` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `basename` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '存储的文件名',
  `path` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '存储文件路径',
  `hash` varchar(50) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '文件MD5',
  `size` int(10) unsigned NOT NULL COMMENT '文件大小',
  `cdn_at` timestamp NULL DEFAULT NULL COMMENT '上传CDN的时间',
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `deleted_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `attachment_files_hash_size_unique` (`hash`,`size`),
  KEY `attachment_files_hash_index` (`hash`),
  KEY `attachment_files_size_index` (`size`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

